import { createSelector } from 'reselect';
import { HOT_DOGS_KEY } from '../constants';

const getRouteData = (state) => state[HOT_DOGS_KEY];

export const allRoutesSelector = createSelector(getRouteData, (hotDogs) => hotDogs.hotDogs);
